double *rdbuf,*pbuf;
void generate_pluck(double f,int t,int wavetable_id,double fct)
{
	static int size;
	size=int(44100/f);
	rdbuf=new double[size];
	pbuf=new double[t];
	for(int i=0;i<size;i++)
		rdbuf[i]=table[wavetable_id][((long long)(c*i*f)%3294198+3294198)%3294198];
	pbuf[0]=rdbuf[0];
	for(int i=1;i<t;i++)
	{
		rdbuf[i%size]=(rdbuf[i%size]+fct*rdbuf[(i+size-1)%size])/(fct+1);
		pbuf[i]=rdbuf[i%size];
	}
}
double rrand()
{
	static random_device rd;
	static mt19937_64 r(rd());
	static uniform_real_distribution<double> dis;
	return dis(r);
}
bool p(double prob)
{
	return (rrand()<=prob);
}
void generate_drum(double f,int t,int prob)
{
	static int size;
	size=int(44100/f);
	rdbuf=new double[size];
	pbuf=new double[t];
	for(int i=0;i<size;i++)
		rdbuf[i]=int(rrand()*65536)%65536-32768;
	pbuf[0]=rdbuf[0];
	for(int i=1;i<t;i++)
	{
		rdbuf[i%size]=(p(prob)?1:-1)*(rdbuf[i%size]+rdbuf[(i+size-1)%size])/2;
		pbuf[i]=rdbuf[i%size];
	}
}
inline double get_pluck(int t)
{
	return pbuf[t];
}
inline double fast_guitar_l(double n,double t,double e,double gt)
{
	return get_pluck(n)*(1+sin(gt/guitar_lfo_div)*guitar_lfo_amp)*(tanh(0.025*t-5)+1)*(tanh(0.025*e-5)+1)/(1+t/1e9);
}
inline double fast_guitar_r(double n,double t,double e,double gt)
{
	return get_pluck(n)*(1-sin(gt/guitar_lfo_div)*guitar_lfo_amp)*(tanh(0.025*t-5)+1)*(tanh(0.025*e-5)+1)/(1+t/1e9);
}
double cymbal(double t)
{
	return rrand()/(1+t/1920);
}
double drum(double t,double f,double e)
{
	return (rrand()/(1+t/70)+sin(pi/44100*t*f/(1+t/5000)*2))/(1+t/2000)*(tanh(0.1*e-5)+1)/2;
}
double snare(double t,double f,double e)
{
	return cymbal(t)/2+drum(t,f/5,e)/2;
}
double clap(double t,double e)
{
	static int sample_dur=1000;
	static double amps[12]={0,1,0,0.8,0,0.9,0.1,0.5,0.05,0.7,0.3,0};
	return rrand()*(t>sample_dur*12?amps[11]:(amps[int(t/sample_dur)]*(t-int(t/sample_dur)*sample_dur)+amps[int(t/sample_dur+1)]*(sample_dur-t+int(t/sample_dur)/sample_dur))/4410)*(tanh(0.1*e-5)+1)/2;
}
void reverb()
{
	for(int i=4410;i<bufsize;i++)
		pcm[i]+=0.4*pcm[i-4410];
	printf("reverb done\n");
}
